const {makeStyles} = require('@material-ui/core')

export const useStyles = makeStyles(() => ({
    root: {
        top: '10px!important'
    },
    modalContent: {
        display: 'flex',
        alignItems: 'center',
        justifyContent: 'center',
    }
}))
